// src/pages/Home.js
import React from "react";
import { regularHours, specialHours } from "../data";
import RegularHours from "../components/RegularHours";
import SpecialHours from "../components/SpecialHours";
import { getCurrentWeekSpecialHours } from "../components/CurrentWeek";

const Home = () => {
  const currentWeekSpecialHours = getCurrentWeekSpecialHours(specialHours);

  return (
    <div>
      <RegularHours hours={regularHours} />
      <SpecialHours hours={currentWeekSpecialHours} highlight={true} />
    </div>
  );
};

export default Home;
